Schema + Resolvers = Server To create a server, the minimum requirement is a query type with a field and a resolver for that field. A simple example: const gql = require("graphql-tag");
const { ApolloServer } = require("apollo-server"); const typeDefs = gql` type User { email: String! avatar: String friends: [User]! } type Query { me: User! }
`; const resolvers = { Query: { me() { return { email: "test@test.com", avatar: "http://yoga.png", friends: [], }; }, },
}; const server = new ApolloServer({ typeDefs, resolvers,
}); server.listen(4000).then(() => { console.log(`Listening on port:${4000}`);
});

